import axios from 'axios'

export const addToOrder = async (order, product) => {
    await axios.post('http://192.168.88.205:3000/newOrder', order, product)
    return {
        type: 'ADD_TO_ORDER',
        payload: await axios.get('http://192.168.88.205:3000/orders')
    }
}
